import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="flex flex-col md:flex-row items-center justify-between bg-gradient-to-r from-blue-500 to-purple-500 text-white p-10 rounded-lg shadow-lg text-white flex justify-between">
      <h1 className="text-lg font-bold">Toko Online</h1>
      <div>
        <Link to="/" className="mx-2">Home</Link>
        <Link to="/products" className="mx-2">Products</Link>
        <Link to="/about" className="mx-2">Tentang Toko</Link>
        <Link to="/contact" className="mx-2">Kontak Toko</Link>
      </div>
    </nav>
  );
};
export default Navbar;
